//www.allegromicro.com/en","https://www.johnsoncontrols.com","https://www.gambling.com/corporate","https://www.amdocs.com","https://www.concretepumpingholdings.com","https://www.chuys.com","https://www.starbucks.com","https://www.csgi.com","https://www.bloominbrands.com","https://www.adobe.com","https://www.diamond-hill.com","https://www.autodesk.com","https://www.everettbank.com","https://www.skyworksinc.com","https://www.cisco.com","https://www.fiiwarsaw.com","https://www.rockwellautomation.com","https://localfirstbank.com","https://www.fivestarbank.com","https://www.fivestarbank.com","https://www.fivestarbank.com","https://www.fivestarbank.com","https://www.ezcorp.com","https://www.roberthalf.com","https://www.factset.com","https://www.chsinc.com","https://www.enterprisebank.com","https://www.easternbank.com","https://www.enterprisebanking.com","https://www.firstharrison.com","https://www.cogentco.com","https://www.gendigital.com",null,"https://www.frontdoorhome.com","https://www.euronetworldwide.com",null,"https://www.canadiansolar.com","https://cvgrp.com","https://www.greatelmgroup.com","https://www.docgo.com","https://www.carnivalcorp.com","https://www.domo.com","https://www.viantinc.com","https://www.qk365.com","https://gdev.inc","https://www.gilat.com","https://www.glpropinc.com","https://www.gogoair.com","https://www.gorilla-technology.com","https://www.gravity.co.kr","https://www.goosehead.com","https://www.thehackettgroup.com","https://www.sands.com","https://www.slb.com"],"shape":[125],"dtype":"object","order":"little"}],["description",{"type":"ndarray","array":["Alliance Resource Partners, L.P., a diversified natural resource company, produces and markets coal primarily to utilities and industrial users in the United States. The company operates through four segments: Illinois Basin Coal Operations, Appalachia Coal Operations, Oil &amp; Gas Royalties, and Coal Royalties. It produces a range of thermal and metallurgical coal with sulfur and heat contents. The company operates seven underground mining complexes in Illinois, Indiana, Kentucky, Maryland, Pennsylvania, and West Virginia. In addition, it leases land and operates a coal loading terminal on the Ohio River at Mt. Vernon, Indiana; and buys and resells coal, as well as owns mineral and royalty interests in approximately 1.5 million gross acres of oil and gas producing regions primarily in the Permian, Anadarko, and Williston Basins. Further, the company offers various mining technology products and services, including data network, communication and tracking systems, mining proximity detection systems, industrial collision avoidance systems, and data and analytics software. As of December 31, 2021, it had approximately 547.1 million tons of proven and probable coal mineral reserves, as well as 1.17 billion tons of measured, indicated, and inferred coal mineral resources in Illinois, Indiana, Kentucky, Maryland, Pennsylvania, and West Virginia. The company was founded in 1971 and is headquartered in Tulsa, Oklahoma.","Palo Alto Networks, Inc. provides cybersecurity solutions worldwide. The company offers firewall appliances and software; Panorama, a security management solution for the control of firewall appliances and software deployed on an end-customer's network and instances in public or private cloud environments, as a virtual or a physical appliance; and virtual system upgrades, which are available as extensions to the virtual system capacity that ships with physical appliances. It also provides subscription services covering the areas of threat prevention, malware and persistent threat, uniform resource locator filtering, laptop and mobile device protection, and firewall; and DNS security, Internet of Things security, SaaS security API, and SaaS security inline, as well as threat intelligence, and data loss prevention. In addition, the company offers cloud security, secure access, security analytics and automation, and threat intelligence and cyber security consulting; professional services, including architecture design and planning, implementation, configuration, and firewall migration; education services, such as certifications, as well as online and in-classroom training; and support services. Palo Alto Networks, Inc. sells its products and services through its channel partners, as well as directly to medium to large enterprises, service providers, and government entities operating in various industries, including education, energy, financial services, government entities, healthcare, Internet and media, manufacturing, public sector, and telecommunications. The company was incorporated in 2005 and is headquartered in Santa Clara, California.","Synopsys, Inc. provides electronic design automation software products used to design and test integrated circuits. The company offers Fusion Design Platform that provides digital design implementation solutions; Verification Continuum Platform that provides virtual prototyping, static and formal verification, simulation, emulation, field programmable gate array (FPGA)-based prototyping, and debug solutions; and FPGA design products that are programmed to perform specific functions. It also provides intellectual property (IP) solutions for USB, PCI Express, DDR, Ethernet, SATA, MIPI, HDMI, and Bluetooth low energy applications; analog IP, including data converters and audio codecs; and system-on-chip (SoC) infrastructure IP, datapath and building block IP, and verification IP products, as well as mathematical and floating-point components, and Arm AMBA interconnect fabric and peripherals. In addition, the company offers logic libraries and embedded memories; configurable processor cores and application-specific instruction-set processor tools for embedded applications; IP subsystems for audio, sensor, and data fusion functionality; and security IP solutions. Further, it provides Platform Architect solutions for SoC architecture analysis and optimization; virtual prototyping solutions; and HAPS FPGA-based prototyping systems, as well as a series of tools used in the design of optical systems and photonic devices. Additionally, the company offers security testing, managed services, programs and professional services, and training that enable its customers to detect and remediate security vulnerabilities, and defects in the software development lifecycle, as well as manufacturing solutions. It serves electronics, financial services, automotive, medicine, energy, and industrial areas. The company was incorporated in 1986 and is headquartered in Mountain View, California.","Dorchester Minerals, L.P. engages in the acquisition, ownership, and administration of producing and nonproducing natural gas and crude oil royalty, net profit, and leasehold interests in the United States. Its royalty properties consist of producing and nonproducing mineral, royalty, and overriding royalty interests located in 582 counties and parishes in 26 states; and net profits interests represent net profits overriding royalty interests in various properties owned by the operating partnership. Dorchester Minerals Management LP serves as the general partner of Dorchester Minerals, L.P. The company was founded in 1982 and is based in Dallas, Texas.","PTC Inc. operates as software and services company in the Americas, Europe, and the Asia Pacific. The company operates in two segments, Software Products and Professional Services. It offers ThingWorx platform, which offers a set of capabilities that enable enterprises to digitally transform every aspect of their business with innovative solutions that are simple to create, easy to implement, scalable to meet future needs, and designed to enable customers to accelerate time to value; and Vuforia, which enables the visualization of digital information in a physical context and the creation of AR. The company also provides Onshape, a software-as-a-service product development platform unites computer-aided design with data management, collaboration tools, and real-time analytics; Arena, a PLM solution enables product teams to collaborate virtually anytime and anywhere; Creo, a 3D CAD technology enables the digital design, testing, and modification of product models; and Windchill, a product lifecycle management software. In addition, it offers Integrity, an application lifecycle management solution; Servigistics, service parts management solution; and consulting, implementation, training, cloud, and license and support services. The company was formerly known as Parametric Technology Corporation and changed its name to PTC Inc. in January 2013. PTC Inc. was incorporated in 1985 and is headquartered in Boston, Massachusetts.","Ares Capital Corporation is a business development company specializing in acquisition, recapitalization, mezzanine debt, restructurings, rescue financing, and leveraged buyout transactions of middle market companies. It also makes growth capital and general refinancing. It prefers to make investments in companies engaged in the basic and growth manufacturing, business services, consumer products, health care products and services, and information technology service sectors. The fund will also consider investments in industries such as restaurants, retail, oil and gas, and technology sectors. It focuses on investments in Northeast, Mid-Atlantic, Southeast and Southwest regions from its New York office, the Midwest region, from the Chicago office, and the Western region from the Los Angeles office. The fund typically invests between $20 million and $200 million and a maximum of $400 million in companies with an EBITDA between $10 million and $250 million. It makes debt investments between $10 million and $100 million The fund invests through revolvers, first lien loans, warrants, unitranche structures, second lien loans, mezzanine debt, private high yield, junior capital, subordinated debt, and non-control preferred and common equity. The fund also selectively considers third-party-led senior and subordinated debt financings and opportunistically considers the purchase of stressed and discounted debt positions. The fund prefers to be an agent and/or lead the transactions in which it invests. The fund also seeks board representation in its portfolio companies.","Fidus Investment Corporation is a business development company. It specializing in leveraged buyouts, refinancings, change of ownership transactions, recapitalizations, strategic acquisitions, mezzanine, growth capital, business expansion, lower middle market investments, debt investments, subordinated and second lien loans, senior secured and unitranche debt, preferred equity, warrants, subordinated debt, senior subordinated notes, junior secured loans, and unitranche loans. It does not invest in turnarounds or distressed situations. The fund prefers to invest in aerospace and defense, business services, consumer products and services including retail, food, and beverage, healthcare products and services, industrial products and services, information technology services, niche manufacturing, transportation and logistics, and value-added distribution sectors. It seeks to invest in companies based in United States. The fund typically invests between $5 million and $15 million per transaction in companies with annual revenues between $10 million and $150 million and an annual EBITDA between $3 million and $20 million, but it can occasionally invest in larger or smaller companies. It seeks to acquire minority equity stakes and board observation rights in conjunction with its investments.","First Community Bankshares, Inc. operates as the financial holding company for First Community Bank that provides various banking products and services. It offers demand deposit accounts, savings and money market accounts, certificates of deposit, and individual retirement arrangements; commercial, consumer, and real estate mortgage loans, as well as lines of credit; various credit and debit cards, and automated teller machine card services; and corporate and personal trust services. The company also provides wealth management services, including trust management, estate administration, and investment advisory services; and investment management services. It serves individuals and businesses across various industries, such as education, government, and health services; coal mining and gas extraction; retail trade; construction; manufacturing; tourism; and transportation. As of December 31, 2021, the company operated 49 branches, including 17 branches in West Virginia, 23 branches in Virginia, 7 branches in North Carolina, and 2 branches in Tennessee. First Community Bankshares, Inc. was founded in 1874 and is headquartered in Bluefield, Virginia.","Formula Systems (1985) Ltd., through its subsidiaries, provides proprietary and non-proprietary software solutions, IT professional services, software product marketing and support, and computer infrastructure and integration solutions worldwide. The company offers computer and telecommunication infrastructure solutions; computer solutions to computer and communications infrastructures; cloud computing solutions; and database and big data services. It also provides customer relations management, computer systems management infrastructures, web world content management, database and data warehouse mining, application integration, database and system, data management, and software development tools; and professional training courses and advanced professional studies. In addition, it markets and sells computers and peripheral equipment to business customers; offers property and casualty insurance platforms, such as Sapiens, Sapiens CoreSuite, Sapiens IDITSuite, Sapiens PolicyPro, Sapiens BillingPro, Sapiens ClaimsPro, e-Tica, and Tia Enterprise; life, pension, and annuities platforms, including Sapiens CoreSuite, Sapiens UnderwritingPro, Sapiens ApplicationPro, Sapiens IllustrationPro, and Sapiens ConsolidationMaster; reinsurance software solutions comprising Sapiens ReinsuranceMaster, Sapiens ReinsurancePro, and Sapiens Reinsurance GO; and Sapiens platform for workers' compensation solutions. Further, the company provides financial and compliance solutions that include Sapiens FinancialPro, Sapiens Financial GO, and Sapiens StatementPro; Sapiens DECISION, a decision management platform; and technology-based solutions. Additionally, it offers application development and business process integration platforms; vertical software solutions; strategic consulting and outsourcing services; and professional services in various areas, as well as develops on-premise payroll software. Formula Systems (1985) Ltd. was incorporated in 1985 and is headquartered in Or Yehuda, Israel.","Formula Systems (1985) Ltd., through its subsidiaries, provides proprietary and non-proprietary software solutions, IT professional services, software product marketing and support, and computer infrastructure and integration solutions worldwide. The company offers computer and telecommunication infrastructure solutions; computer solutions to computer and communications infrastructures; cloud computing solutions; and database and big data services. It also provides customer relations management, computer systems management infrastructures, web world content management, database and data warehouse mining, application integration, database and system, data management, and software development tools; and professional training courses and advanced professional studies. In addition, it markets and sells computers and peripheral equipment to business customers; offers property and casualty insurance platforms, such as Sapiens, Sapiens CoreSuite, Sapiens IDITSuite, Sapiens PolicyPro, Sapiens BillingPro, Sapiens ClaimsPro, e-Tica, and Tia Enterprise; life, pension, and annuities platforms, including Sapiens CoreSuite, Sapiens UnderwritingPro, Sapiens ApplicationPro, Sapiens IllustrationPro, and Sapien iens ConsolidationMaster; reinsurance software solutions comprising Sapiens ReinsuranceMaster, Sapiens ReinsurancePro, and Sapiens Reinsurance GO; and Sapiens platform for workers' compensation solutions. Further, the company provides financial and compliance solutions that include Sapiens FinancialPro, Sapiens Financial GO, and Sapiens StatementPro; Sapiens DECISION, a decision management platform; and technology-based solutions. Additionally, it offers application development and business process integration platforms; vertical software solutions; strategic consulting and outsourcing services; and professional services in various areas, as well as develops on-premise payroll software. Formula Systems (1985) Ltd. was incorporated in 1985 and is headquartered in Or Yehuda, Israel.","Formula Systems (1985) Ltd., through its subsidiaries, provides proprietary and non-proprietary software solutions, IT professional services, software product marketing and support, and computer infrastructure and integration solutions worldwide. The company offers computer and telecommunication infrastructure solutions; computer solutions to computer and communications infrastructures; cloud computing solutions; and database and big data services. It also provides customer relations management, computer systems management infrastructures, web world content management, database and data warehouse mining, application integration, database and system, data management, and software development tools; and professional training courses and advanced professional studies. In addition, it markets and sells computers and peripheral equipment to business customers; offers property and casualty insurance platforms, such as Sapiens, Sapiens CoreSuite, Sapiens IDITSuite, Sapiens PolicyPro, Sapiens BillingPro, Sapiens ClaimsPro, e-Tica, and Tia Enterprise; life, pension, and annuities platforms, including Sapiens CoreSuite, Sapiens UnderwritingPro, Sapiens ApplicationPro, Sapiens IllustrationPro, and Sapiens ConsolidationMaster; reinsurance software solutions comprising Sapiens ReinsuranceMaster, Sapiens ReinsurancePro, and Sapiens Reinsurance GO; and Sapiens platform for workers' compensation solutions. Further, the company provides financial and compliance solutions that include Sapiens FinancialPro, Sapiens Financial GO, and Sapiens StatementPro; Sapiens DECISION, a decision management platform; and technology-based solutions. Additionally, it offers application development and business process integration platforms; vertical software solutions; strategic consulting and outsourcing services; and professional services in various areas, as well as develops on-premise payroll software. Formula Systems (1985) Ltd. was incorporated in 1985 and is headquartered in Or Yehuda, Israel.","Teradyne, Inc. designs, develops, manufactures, sells, and supports automatic test equipment worldwide. The company operates through Semiconductor Test, System Test, Industrial Automation, and Wireless Test segments. The Semiconductor Test segment offers products and services for wafer level and device package testing in automotive, industrial, communications, consumer, smartphones, cloud computer and electronic game, and other applications. This segment also provides FLEX test platform systems; J750 test system to address the volume semiconductor devices; Magnum platform that tests memory devices, such as flash memory and DRAM; and ETS platform for semiconductor manufacturers, and assembly and test subcontractors in the analog/mixed signal markets. It serves integrated device manufacturers that integrate the fabrication of silicon wafers into their business; fabless companies that outsource the manufacturing of silicon wafers; foundries; and semiconductor assembly and test providers. The System Test segment offers defense/aerospace test instrumentation and systems; storage test systems; and circuit-board test and inspection systems. The Industrial Automation segment provides collaborative robotic arms, autonomous mobile robots, and advanced robotic control software for manufacturing, logistics, and light industrial customers. The Wireless Test segment provides test solutions for use in the development and manufacture of wireless devices and modules, smartphones, tablets, notebooks, laptops, peripherals, and Internet-of-Things devices under the LitePoint brand name. This segment also offers IQxel products for Wi-Fi and other standards; IQxstream solution for testing GSM, EDGE, CDMA2000, TD-SCDMA, WCDMA, HSPA+, LTE, and 5G technologies; IQcell, a multi-device cellular signaling test solution; IQgig test solution; and turnkey test software for wireless chipsets. Teradyne, Inc. was incorporated in 1960 and is headquartered in North Reading, Massachusetts.","Avnet, Inc., a technology solutions company, markets, sells, and distributes electronic components. The company operates through two segments, Electronic Components and Farnell. The Electronic Components segment markets, sells, and distributes semiconductors; interconnect, passive, and electromechanical devices; and other integrated components from electronic component manufacturers. It also offers design chain support that provides engineers with technical design solutions; engineering and technical resources to support product design, bill of materials development, and technical education and training; and supply chain solutions that provide support and logistical services to original equipment manufacturers, electronic manufacturing service providers, and electronic component manufacturers. In addition, this segment provides integrated solutions, such as technical design, integration, and assembly of embedded products, and systems and solutions primarily for industrial applications, as well as for intelligent and innovative embedded display solutions comprising touch and passive displays. Further, it develops and manufactures standard board and industrial subsystems, and application-specific devices that enable it to produce systems tailored to specific customer requirements. This segment serves various markets, such as automotive, medical, defense, aerospace, telecommunications, industrial, and digital editing. The Farnell segment distributes kits, tools, and electronic and industrial automation components, as well as test and measurement products to engineers and entrepreneurs. It has operations in the Americas, Europe, the Middle East, Africa, and the Asia Pacific. Avnet, Inc. was founded in 1921 and is headquartered in Phoenix, Arizona.","Daily Journal Corporation publishes newspapers and websites covering in California, Arizona, and Utah. It operates in two segments, Traditional Business and Journal Technologies. The company publishes 10 newspapers of general circulation, including Los Angeles Daily Journal, San Francisco Daily Journal, Daily Commerce, The Daily Recorder, The Inter-City Express, San Jose Post-Record, Orange County Reporter, The Daily Transcript, Business Journal, and The Record Reporter. It also provides specialized information services; and serves as an advertising and newspaper representative for commercial and public notice advertising. In addition, the company offers case management software systems and related products, including eCourt, eProsecutor, eDefender, and eProbation, which are browser-based case processing systems; eFile, a browser-based interface that allows attorneys and the general public to electronically file documents with the court; and ePayIt, a service primarily for the online payment of traffic citations. It provides its software systems and related products for courts; prosecutor and public defender offices; probation departments; and other justice agencies, including administrative law organizations, city and county governments, and bar associations to manage cases and information electronically, to interface with other justice partners, and to extend electronic services to bar members and the public in 42 states and internationally. Daily Journal Corporation was incorporated in 1987 and is based in Los Angeles, California.","First Mid Bancshares, Inc., a financial holding company, provides community banking products and services to commercial, retail, and agricultural customers in the United States. It accepts various deposit products, such as demand deposits, savings accounts, money market deposits, and time deposits. The company's loan products include commercial real estate, commercial and industrial, agricultural and agricultural real estate, residential real estate, and consumer loans; and other loans comprising loans to municipalities to support community projects, such as infrastructure improvements or equipment purchases. It also offers wealth management services, which include estate planning, investment, and farm management and brokerage services for individuals; and employee benefit services for business enterprises. In addition, the company provides property and casualty, senior insurance products, and group medical insurance for businesses; and personal lines insurance to individuals. It operates through a network of 52 banking centers in Illinois and 14 offices in Missouri, as well as a loan production office in Indiana. The company was formerly known as First Mid-Illinois Bancshares, Inc. and changed its name to First Mid Bancshares, Inc. in April 2019. First Mid Bancshares, Inc. was founded in 1865 and is headquartered in Mattoon, Illinois.","Balchem Corporation develops, manufactures, and markets specialty performance ingredients and products for the nutritional, food, pharmaceutical, animal health, medical device sterilization, plant nutrition, and industrial markets in the United States and internationally. It operates through three segments: Human Nutrition &amp; Health, Animal Nutrition &amp; Health, and Specialty Products. The Human Nutrition &amp; Health segment supplies ingredients in the food and beverage industry. Its products include spray dried and emulsified powders, extrusion and agglomeration, blended lipid systems, liquid flavor delivery systems, juice and dairy bases, chocolate systems, and cereal systems, as well as ice cream bases and variegates. This segment also offers microencapsulation solutions for various applications; and human grade choline nutrients and mineral amino acid chelated products for nutrition and health applications. The Animal Nutrition &amp; Health segment provides microencapsulated products to enhance health and milk production, and delivering nutrient supplements in ruminant animals; chelation technology, which offers enhanced nutrient absorption for various species of production and companion animals; and choline chloride, a nutrient for monogastric animal health. The Specialty Products segment offers ethylene oxide primarily for use in the health care industry; and single use canisters with ethylene oxide for sterilizing re-usable devices. This segment also markets and sells propylene oxide, a fumigant to aid in the control of insects and microbiological spoilage, as well as to reduce bacterial and mold contamination in shell and processed nut meats, processed spices, cacao beans, cocoa powder, raisins, figs, and prunes; and chelated minerals for high value crops. The company sells its products through sales force, independent distributors, and sales agents. Balchem Corporation was incorporated in 1967 and is headquartered in New Hampton, New York.","Churchill Downs Incorporated operates as a racing, online wagering, and gaming entertainment company in the United States. It operates through three segments: Live and Historical Racing, TwinSpires, and Gaming. As of December 31, 2021, the company owned and operated three pari-mutuel gaming entertainment venues with approximately 3,050 historical racing machines (HRMs) in Kentucky; TwinSpires, an online wagering platform for horse racing, sports, and iGaming; nine retail sportsbooks; and casino gaming in eight states with approximately 11,000 slot machines and video lottery terminals, and 200 table games. It also offers streaming video of live horse races, replays, and an assortment of racing and handicapping information; and provides the Bloodstock Research Information Services platform for horse racing statistical data. In addition, the company manufactures and operates pari-mutuel wagering systems for racetracks, off-track betting facilities, and other pari-mutuel wagering businesses. Churchill Downs Incorporated was founded in 1875 and is headquartered in Louisville, Kentucky.","Great Elm Group, Inc. is an alternative asset management company focused on growing a scalable and diversified portfolio of long-duration and permanent capital vehicles across credit, real estate, specialty finance, and other alternative strategies. With its subsidiaries, it currently manages Great Elm Capital Corp., a publicly-traded business development company, and Monomoy Properties REIT, LLC, an industrial-focused real estate investment trust, in addition to other investments. The company was founded in 1994 and is headquartered in Waltham, MA.","TE Connectivity Ltd., together with its subsidiaries, manufactures and sells connectivity and sensor solutions in Europe, the Middle East, Africa, the Asia\u0096Pacific, and the Americas. The company operates through three segments: Transportation Solutions, Industrial Solutions, and Communications Solutions. The Transportation Solutions segment provides terminals and connector systems and components, sensors, relays, antennas, heat shrink tubing, and application tooling products for use in the automotive, commercial transportation, and sensor markets. The Industrial Solutions segment offers terminals and connector systems and components; and heat shrink tubing, interventional medical components, relays, and wires and cables for aerospace, defense, oil and gas, industrial equipment, medical, and energy markets. The Communications Solutions segment supplies electronic components, such as terminals and connector systems and components, relays, heat shrink tubing, and antennas for the data and devices, and appliances markets. TE Connectivity Ltd. sells its products to approximately 140 countries primarily through direct sales to manufacturers, as well as through third-party distributors. The company was formerly known as Tyco Electronics Ltd. and changed its name to TE Connectivity Ltd. in March 2011. TE Connectivity Ltd. was incorporated in 2000 and is based in Schaffhausen, Switzerland.","First Financial Bancorp. operates as the bank holding company for First Financial Bank that provides commercial banking and related services to individuals and businesses in Ohio, Indiana, Kentucky, and Illinois. The company accepts various deposit products, such as interest-bearing and noninterest-bearing accounts, time deposits, and cash management services for commercial customers. It also provides real estate loans secured by residential property, such as one to four family residential housing units or commercial property comprising owner-occupied and/or investor income producing real estate consisting of apartments, shopping centers, or office buildings; commercial and industrial loans for various purposes, including inventory, receivables, and equipment; consumer loans comprising new and used vehicle loans, second mortgages on residential real estate, and unsecured loans; and home equity lines of credit. In addition, the company offers commercial financing to the insurance industry, registered investment advisors, certified public accountants, indirect auto finance companies, and restaurant franchisees. Further, it provides a range of trust and wealth management services; and lease and equipment financing services. As of December 31, 2021, the company operated 139 full service banking centers, 29 of which are leased facilities. It operates 62 banking centers in Ohio, three banking centers in Illinois, 62 banking centers in Indiana, and 12 banking centers in Kentucky. First Financial Bancorp. was founded in 1863 and is headquartered in Cincinnati, Ohio.","StealthGas Inc., together with its subsidiaries, provides seaborne transportation services to liquefied petroleum gas (LPG) producers and users internationally. It also provides crude oil and natural gas. The company's carriers carry various petroleum gas products in liquefied form, including propane, butane, butadiene, isopropane, propylene, and vinyl chloride monomer; and refined petroleum products, such as gasoline, diesel, fuel oil, and jet fuel, as well as edible oils and chemicals. As of December 31, 2021, it had a fleet of 44 LPG carriers with a total capacity of 389,426 cubic meters; three medium range product carriers with a total capacity of 140,000 deadweight tons (dwt); and one Aframax crude oil tanker with a total capacity of 115,804 dwt. StealthGas Inc. was incorporated in 2004 and is based in Athens, Greece.","Greene County Bancorp, Inc. operates as a holding company for The Bank of Greene County that provides various financial services in the United States. Its deposit products include savings, NOW accounts, money market accounts, certificates of deposit, non-interest bearing checking accounts, and individual retirement accounts. The company's loan portfolio consists of residential, construction and land, and multifamily mortgage loans; commercial real estate mortgage loans; consumer loans, such as loans on new and used automobiles, personal loans, and home equity loans, as well as other consumer installment loans, including passbook loans, unsecured home improvement loans, recreational vehicle loans, and deposit account overdrafts; and commercial loans. As of June 30, 2021, it operated a network of 17 full-service banking offices. The company was founded in 1889 and is based in Catskill, New York. Greene County Bancorp, Inc. is a subsidiary of Greene County Bancorp, MHC.","Flex Ltd. provides design, engineering, manufacturing, and supply chain services and solutions to original equipment manufacturers in Asia, the Americas, and Europe. It operates through three segments: Flex Agility Solutions (FAS), Flex Reliability Solutions (FRS), and Nextracker. The company provides cross-industry technologies, including human-machine interface, internet of things platforms, power, sensor fusion, and smart audio. It also offers integrated solar tracker and software solutions used in utility-scale and ground-mounted distributed generation solar projects. In addition, the company provides value-added design and engineering services; and systems assembly and manufacturing services that include enclosures, testing services, and materials procurement and inventory management services. Further, it offers chargers for smartphones and tablets; adapters for notebooks and gaming systems; power supplies for the server, storage, and networking markets; and power solutions, such as switchgear, busway, power distribution, modular power systems, and monitoring solutions and services. Additionally, the company provides after-market and forward supply chain logistics services to computing, consumer digital, infrastructure, industrial, mobile, automotive, and medical industries; and reverse logistics and repair solutions, including returns management, exchange programs, complex repair, asset recovery, recycling, and e-waste management. It serves to cloud, communications, enterprise, automotive, industrial, consumer devices, lifestyle, healthcare, and energy industries. The company was formerly known as Flextronics International Ltd. and changed its name to Flex Ltd. in September 2016. Flex Ltd. was incorporated in 1990 and is based in Singapore.","First Merchants Corporation operates as the financial holding company for First Merchants Bank that provides community banking services. It accepts time, savings, and demand deposits; and provides consumer, commercial, agri-business, and real estate mortgage loans, as well as public finance. The company also offers personal and corporate trust; brokerage and private wealth management; and letters of credit, repurchase agreements, and other corporate services. It operates 109 banking locations in Indiana, Illinois, Ohio, and Michigan counties. The company also offers its services through electronic and mobile delivery channels. First Merchants Corporation was founded in 1893 and is headquartered in Muncie, Indiana.","First Merchants Corporation operates as the financial holding company for First Merchants Bank that provides community banking services. It accepts time, savings, and demand deposits; and provides consumer, commercial, agri-business, and real estate mortgage loans, as well as public finance. The company also offers personal and corporate trust; brokerage and private wealth management; and letters of credit, repurchase agreements, and other corporate services. It operates 109 banking locations in Indiana, Illinois, Ohio, and Michigan counties. The company also offers its services through electronic and mobile delivery channels. First Merchants Corporation was founded in 1893 and is headquartered in Muncie, Indiana.","First Merchants Corporation operates as the financial holding company for First Merchants Bank that provides community banking services. It accepts time, savings, and demand deposits; and provides consumer, commercial, agri-business, and real estate mortgage loans, as well as public finance. The company also offers personal and corporate trust; brokerage and private wealth management; and letters of credit, repurchase agreements, and other corporate services. It operates 109 banking locations in Indiana, Illinois, Ohio, and Michigan counties. The company also offers its services through electronic and mobile delivery channels. First Merchants Corporation was founded in 1893 and is headquartered in Muncie, Indiana.","First Merchants Corporation operates as the financial holding company for First Merchants Bank that provides community banking services. It accepts time, savings, and demand deposits; and provides consumer, commercial, agri-business, and real estate mortgage loans, as well as public finance. The company also offers personal and corporate trust; brokerage and private wealth management; and letters of credit, repurchase agreements, and other corporate services. It operates 109 banking locations in Indiana, Illinois, Ohio, and Michigan counties. The company also offers its services through electronic and mobile delivery channels. First Merchants Corporation was founded in 1893 and is headquartered in Muncie, Indiana.","Lockheed Martin Corporation, a security and aerospace company, engages in the research, design, development, manufacture, integration, and sustainment of technology systems, products, and services worldwide. It operates through four segments: Aeronautics, Missiles and Fire Control, Rotary and Mission Systems, and Space. The Aeronautics segment offers combat and air mobility aircraft, unmanned air vehicles, and related technologies. The Missiles and Fire Control segment provides air and missile defense systems; tactical missiles and air-to-ground precision strike weapon systems; logistics; fire control systems; mission operations support, readiness, engineering support, and integration services; manned and unmanned ground vehicles; and energy management solutions. The Rotary and Mission Systems segment offers military and commercial helicopters, surface ships, sea and land-based missile defense systems, radar systems, sea and air-based mission and combat systems, command and control mission solutions, cyber solutions, and simulation and training solutions. The Space segment offers satellites; space transportation systems; strategic, advanced strike, and defensive missile systems; and classified systems and services in support of national security systems. This segment also provides network-enabled situational awareness and integrates space and ground-based systems to help its customers gather, analyze, and securely distribute critical intelligence data. It serves primarily serves the U.S. government, as well as foreign military sales contracted through the U.S. government. Lockheed Martin Corporation was founded in 1912 and is headquartered in Bethesda, Maryland.","Columbia Sportswear Company, together with its subsidiaries, designs, sources, markets, and distributes outdoor, active, and everyday lifestyle apparel, footwear, accessories, and equipment in the United States, Latin America, the Asia Pacific, Europe, the Middle East, Africa, and Canada. The company provides apparel, accessories, and equipment that are used in various activities, such as skiing, snowboarding, hiking, climbing, mountaineering, camping, hunting, fishing, trail running, water sports, yoga, golf, and adventure travel. It also offers footwear products that include lightweight hiking boots, trail running shoes, rugged cold weather boots for activities on snow and ice, sandals and shoes for use in water activities, and function-first fashion footwear and casual shoes for everyday use. The company sells its products under the Columbia, Mountain Hardwear, SOREL, and prAna brand names through the company owned network of branded and outlet retail stores, brand-specific e-commerce sites, and concession-based arrangements with third-parties at branded outlet and shop-in-shop retail locations, as well as through independently operated specialty outdoor and sporting goods stores, sporting goods chains, department store chains, Internet retailers, and international distributors. As of December 31, 2021, it operated approximately 455 retail stores. The company was founded in 1938 and is headquartered in Portland, Oregon.","Amcor plc develops, produces, and sells packaging products in Europe, North America, Latin America, Africa, and the Asia Pacific regions. The company operates through two segments, Flexibles and Rigid Packaging. The Flexibles segment provides flexible and film packaging products in the food and beverage, medical and pharmaceutical, fresh produce, snack food, personal care, and other industries. The Rigid Packaging segment offers rigid containers for a range of beverage and food products, including carbonated soft drinks, water, juices, sports drinks, milk-based beverages, spirits and beer, sauces, dressings, spreads, and personal care items; and plastic caps for various applications. The company sells its products primarily through its direct sales force. Amcor plc was incorporated in 2018 and is headquartered in Z\u00fcrich, Switzerland.","Cass Information Systems, Inc. provides payment and information processing services to manufacturing, distribution, and retail enterprises in the United States. It operates through two segments, Information Services and Banking Services. The company's services include freight invoice rating, payment processing, auditing, and the generation of accounting and transportation information. It also processes and pays facility-related invoices, such as electricity, gas, waste, and telecommunications expenses; and provides telecom expense management solutions. In addition, the company, through its banking subsidiary, Cass Commercial Bank, provides a range of banking products and services, such as checking, savings, and time deposit accounts; commercial, industrial, and real estate loans; and cash management services to privately-owned businesses and faith-related ministries. Further, it provides B2B payment platform for clients that require an agile fintech partner. It operates through its banking facility near downtown St. Louis, Missouri; operating branch in the Bridgeton, Missouri; and leased facilities in Fenton, Missouri and Colorado Springs, Colorado. The company was formerly known as Cass Commercial Corporation and changed its name to Cass Information Systems, Inc. in January 2001. Cass Information Systems, Inc. was founded in 1906 and is headquartered in St. Louis, Missouri.","Sysco Corporation, through its subsidiaries, engages in the marketing and distribution of various food and related products primarily to the foodservice or food-away-from-home industry in the United States, Canada, the United Kingdom, France, and internationally. It operates through U.S. Foodservice Operations, International Foodservice Operations, SYGMA, and Other segments. The company distributes frozen foods, such as meats, seafood, fully prepared entr\u00e9es, fruits, vegetables, and desserts; canned and dry foods; fresh meats and seafood; dairy products; beverage products; imported specialties; and fresh produce. It also supplies various non-food items, including paper products comprising disposable napkins, plates, and cups; tableware consisting of China and silverware; cookware, which include pots, pans, and utensils; restaurant and kitchen equipment and supplies; and cleaning supplies. The company serves restaurants, hospitals and nursing homes, schools and colleges, hotels and motels, industrial caterers, and other foodservice venues. As of August 27, 2021, it operated 343 distribution facilities. Sysco Corporation was incorporated in 1969 and is headquartered in Houston, Texas.","FRP Holdings, Inc. engages in the real estate businesses in the United States. The company operates through four segments: Asset Management, Mining Royalty Lands, Development, and Stabilized Joint Venture. The Asset Management segment owns, leases, and manages commercial properties. The Mining Royalty Lands segment owns various properties comprising approximately 15,000 acres under lease for mining rents or royalties primarily in Florida, Georgia, and Virginia. This segment also owns an additional 107 acres of investment property in Brooksville, Florida. The Development segment owns and monitors the use of parcels of land that are in various stages of development. The Stabilized Joint Venture segment owns, leases, and manages a 305-unit residential apartment building with approximately 14,430 square feet of first floor retail space; 264-unit residential apartment building with 6,758 square feet of retail space; and 294-unit garden-style apartment community located in Henrico County, Virginia that consists of 19 three-story apartment buildings containing 273,940 rentable square feet. FRP Holdings, Inc. was incorporated in 2014 and is based in Jacksonville, Florida.","FRP Holdings, Inc. engages in the real estate businesses in the United States. The company operates through four segments: Asset Management, Mining Royalty Lands, Development, and Stabilized Joint Venture. The Asset Management segment owns, leases, and manages commercial properties. The Mining Royalty Lands segment owns various properties comprising approximately 15,000 acres under lease for mining rents or royalties primarily in Florida, Georgia, and Virginia. This segment also owns an additional 107 acres of investment property in Brooksville, Florida. The Development segment owns and monitors the use of parcels of land that are in various stages of development. The Stabilized Joint Venture segment owns, leases, and manages a 305-unit residential apartment building with approximately 14,430 square feet of first floor retail space; 264-unit residential apartment building with 6,758 square feet of retail space; and 294-unit garden-style apartment community located in Henrico County, Virginia that consists of 19 three-story apartment buildings containing 273,940 rentable square feet. FRP Holdings, Inc. was incorporated in 2014 and is based in Jacksonville, Florida.","FRP Holdings, Inc. engages in the real estate businesses in the United States. The company operates through four segments: Asset Management, Mining Royalty Lands, Development, and Stabilized Joint Venture. The Asset Management segment owns, leases, and manages commercial properties. The Mining Royalty Lands segment owns various properties comprising approximately 15,000 acres under lease Inc. operates as the bank holding company for First US Bank that provides commercial banking products and services. The company offers non-interest-bearing demand deposits, savings accounts, NOW accounts, money market demand accounts, individual retirement accounts, and time deposits. Its loan products include commercial construction, land, and land development loans comprising residential housing, commercial and industrial use property development loans, raw land purchase and improvement loans, and agricultural production loans; mortgage loans on residential properties and apartment buildings; real estate loans secured by commercial and industrial properties, office or mixed-use facilities, strip shopping centers, or other commercial property; loans and leases to commercial customers; and secured and unsecured personal loans, including automobile loans and other direct consumer installment loans. The company also provides loans secured by personal property items, such as furniture, ATVs, and home appliances, as well as recreational vehicles, boats, and cargo trailers. In addition, it provides letters of credit; and safe deposit box and remote deposit capture services, as well as underwrites credit life, and credit accident and health insurance reinsurance policies. The company serves small-and medium-sized businesses, property managers, business executives, professionals, and other individuals. It operates 15 full-service banking offices in Birmingham, Butler, Calera, Centreville, Gilbertown, Grove Hill, Harpersville, Jackson, Thomasville, Tuscaloosa, and Woodstock, Alabama; Knoxville and Powell, Tennessee; and Rose Hill, Virginia, as well as loan production offices in Mobile, Alabama, and the Chattanooga, Tennessee area. The company was formerly known as United Security Bancshares, Inc. and changed its name to First US Bancshares, Inc. in October 2016. First US Bancshares, Inc. was founded in 1952 and is headquartered in Birmingham, Alabama.","First Interstate BancSystem, Inc. operates as the bank holding company for First Interstate Bank that provides range of banking products and services in the United States. It offers various traditional depository products, including checking, savings, and time deposits; and repurchase agreements primarily for commercial and municipal depositors. The company also offers real estate loans comprising commercial real estate, construction, residential, agricultural, and other real estate loans; consumer loans comprising direct personal loans, credit card loans and lines of credit, and indirect loans; variable and fixed rate commercial loans for small and medium-sized manufacturing, wholesale, retail, and service businesses for working capital needs and business expansions; and agricultural loans. In addition, it provides a range of trust, employee benefit, investment management, insurance, agency, and custodial services to individuals, businesses, and nonprofit organizations. Further, the company offers marketing, credit review, loan servicing, credit cards issuance and servicing, mortgage loan sales and servicing, indirect consumer loan purchasing and processing, loan collection services, and other operational services, as well as online and mobile banking services. It serves individuals, businesses, municipalities, and other entities in various industries, including agriculture, construction, education, energy, governmental services, healthcare, hospitality, housing, mining, professional services, real estate development, retail, technology, tourism, and wholesale trade. As of December 31, 2021, it operated 147 banking offices, including detached drive-up facilities in communities across Idaho, Montana, Oregon, South Dakota, Washington, and Wyoming. The company was incorporated in 1971 and is headquartered in Billings, Montana.","AT&amp;T Inc. provides telecommunications, media, and technology services worldwide. Its Communications segment offers wireless voice and data communications services; and sells handsets, wireless data cards, wireless computing devices, and carrying cases and hands-free devices through its own company-owned stores, agents, and third-party retail stores. It also provides data, voice, security, cloud solutions, outsourcing, and managed and professional services, as well as customer premises equipment for multinational corporations, small and mid-sized businesses, governmental, and wholesale customers. In addition, this segment offers broadband fiber and legacy telephony voice communication services to residential customers. It markets its communications services and products under the AT&amp;T, Cricket, AT&amp;T PREPAID, and AT&amp;T Fiber brand names. The company's Latin America segment provides wireless services in Mexico; and video services in Latin America. This segment markets its services and products under the AT&amp;T and Unefon brand names. The company was formerly known as SBC Communications Inc. and changed its name to AT&amp;T Inc. in 2005. AT&amp;T Inc. was incorporated in 1983 and is headquartered in Dallas, Texas.","Geospace Technologies Corporation designs and manufactures instruments and equipment used in the oil and gas industry to acquire seismic data in order to locate, characterize, and monitor hydrocarbon producing reservoirs. The company operates through three segments: Oil and Gas Markets, Adjacent Markets, and Emerging Markets. The Oil and Gas Markets segment offers wireless seismic data acquisition systems and reservoir characterization products and services, as well as traditional seismic exploration products, such as geophones, hydrophones, leader wires, connectors, cables, marine streamer retrieval and steering devices, and other seismic products. The Adjacent Markets segment provides industrial products, including imaging equipment, water meter products, remote shut-off valves and Internet of Things platform, and offshore cables, as well as seismic sensors for vibration monitoring and geotechnical applications, such as mine safety and earthquake detection applications; and electronic pre-press products that employ direct thermal imaging, direct-to-screen printing systems, and digital inkjet printing technologies targeted at the commercial and industrial graphics, textile, and flexographic printing industries. The Emerging Markets segment designs and sells products used for border and perimeter security surveillance, cross-border tunneling detection, and other products targeted at movement monitoring, intrusion detection, and situational awareness. This segment serves customers that include various agencies of the United States government, including the Department of Defense, Department of Energy, Department of Homeland Security, and other agencies. The company operates in Asia, Canada, Europe, the United States, and internationally. Geospace Technologies Corporation was founded in 1980 and is headquartered in Houston, Texas.","G-III Apparel Group, Ltd. designs, sources, and markets women's and men's apparel in the United States and internationally. The company operates through two segments, Wholesale Operations and Retail Operations. Its products include outerwear, dresses, sportswear, swimwear, women's suits, and women's performance wear; and women's handbags, footwear, small leather goods, cold weather accessories, and luggage. The company markets apparel and other products under the proprietary brand names, including DKNY, Donna Karan, Vilebrequin, Eliza J, Jessica Howard, Andrew Marc, Marc New York, Sonia Rykiel, Black Rivet, G-III Sports by Carl Banks, and G-III for Her; and licensed brands, such as Calvin Klein, Tommy Hilfiger, Karl Lagerfeld Paris, Levi's, Guess?, Kenneth Cole, Cole Haan, Vince Camuto, and Dockers. It has licenses with the National Football League, Major League Baseball, National Basketball Association, Major League Baseball, and National Hockey League, as well as approximately 150 U.S. colleges and universities. The company offers its products to department, specialty, and mass merchant retail stores. As of January 31, 2022, it operated 96 Vilebrequin retail stores; 60 DKNY and Karl Lagerfeld Paris stores; and 26 DKNY stores. The company also sells its products online. G-III Apparel Group, Ltd. was founded in 1956 and is headquartered in New York, New York.","Gladstone Capital Corporation is a business development company specializing in lower middle market, growth capital, add on acquisitions, change of control, buy &amp; build strategies, debt refinancing, debt investments in senior term loans, revolving loans, secured first and second lien term loans, senior subordinated loans, unitranche loans, junior subordinated loans, and mezzanine loans and equity investments in the form of common stock, preferred stock, limited liability company interests, or warrants. It operates as a business development company. The fund also makes private equity investments in acquisitions, buyouts and recapitalizations, and refinancing existing debts. It targets small and medium-sized companies in United States. It is industry agnostic and seeks to invest in companies engaged in the business services, light and specialty manufacturing, niche industrial products and services, specialty consumer products and services, energy services, transportation and logistics, healthcare and education services, specialty chemicals, media and communications and aerospace and defense. The fund seeks to invest between $7 million and $30 million in companies that have between $20 million and $150 million in sales and EBITDA between $3 million and $25 million. It prefers to acquire minority stakes. It seeks to exit its investments through strategic acquisitions by other industry participants or financial buyers, initial public offerings of common stock, or other capital market transactions.","Gentex Corporation designs, develops, manufactures, markets, and supplies digital vision, connected car, dimmable glass, and fire protection p e, fitness equipment, and other large parcel categories. The company was formerly known as Oriental Standard Human Resources Holdings Limited and changed its name to GigaCloud Technology Inc. in February 2021. GigaCloud Technology Inc. was founded in 2006 and is headquartered in Suzhou, China.","Akso Health Group operates a social e-commerce mobile platform in China. The company operates Xiaobai Maimai App, which offers food and beverage products, wine, cosmetic products, fashion and apparel, entertainment products, housewares, home appliances, etc. It also offers consultancy and information technology support services; and trades in branded products, as well as promotes products. The company was formerly known as Xiaobai Maimai Inc. and changed its name to Akso Health Group in December 2021. Akso Health Group was founded in 2014 and is headquartered in Beijing, China. As of July 13, 2021, Akso Health Group operates as a subsidiary of Webao Limited.","Tesla, Inc. designs, develops, manufactures, leases, and sells electric vehicles, and energy generation and storage systems in the United States, China, and internationally. It operates in two segments, Automotive, and Energy Generation and Storage. The Automotive segment offers electric vehicles, as well as sells automotive regulatory credits; and non-warranty after-sales vehicle, used vehicles, retail merchandise, and vehicle insurance services. This segment also provides sedans and sport utility vehicles through direct and used vehicle sales, a network of Tesla Superchargers, and in-app upgrades; purchase financing and leasing services; services for electric vehicles through its company-owned service locations and Tesla mobile service technicians; and vehicle limited warranties and extended service plans. The Energy Generation and Storage segment engages in the design, manufacture, installation, sale, and leasing of solar energy generation and energy storage products, and related services to residential, commercial,  in Almaty, Kazakhstan.","Freedom Holding Corp., through its subsidiaries, provides retail securities brokerage, research, investment counseling, securities trading, market making, retail banking, corporate investment banking, and underwriting services. The company offers investment brokerage services for exchange-traded and over-the-counter corporate equity and debt securities, money market instruments, exchange traded options and futures contracts, government bonds, and mutual funds; margin lending services collateralized by securities and cash in the customer's account; various investment education and training courses; investment research services; and commercial banking services, including payment cards, digital mortgages, and digital auto loans, as well as insurance products. It also provides capital raising solutions for corporate clients through initial public offerings and follow-on offerings; and debt capital markets solutions that focuses on structuring and distributing private and public debt for various purposes, including buyouts, acquisitions, growth capital financings, and recapitalizations. In addition, the company is involved in trading, investment, and brokerage activities. Further, it facilitates repurchase and reverse repurchase agreements in proprietary trading activities; and covers short positions and settle other securities obligations to accommodate customers' needs and finance its inventory positions. Additionally, the company offers Tradernet software platform for client margin risk evaluation and middle office security transfer requests. It operates in Central Asia, Europe, the United States, Russia, and the Middle East/Caucasus. The company was formerly known as BMB Munai, Inc. and changed its name to Freedom Holding Corp. Freedom Holding Corp. was incorporated in 1981 and is headquartered in Almaty, Kazakhstan.","Aehr Test Systems provides test systems for burning-in and testing logic, optical, and memory integrated circuits worldwide. It offers products, such as the ABTS and FOX-P families of test and burn-in systems and FOX WaferPak Aligner, FOX-XP WaferPak Contactor, FOX DiePak Carrier, and FOX DiePak Loader. The ABTS system is used in production and qualification testing of packaged parts for lower power and higher power logic devices, as well as various common types of memory devices. The FOX-XP and FOX-NP systems are wafer contact and singulated die/module test and burn-in systems used for burn-in and functional test of complex devices, such as memories, digital signal processors, microprocessors, microcontrollers, systems-on-a-chip, and integrated optical devices. The FOX-CP system is a single-wafer compact test and reliability verification solution for logic, memory, and photonic devices. The WaferPak Contactor contains a unique full wafer probe card capable of testing wafers up to 300mm that enables IC manufacturers to perform test and burn-in of full wafers on Aehr Test FOX systems. The DiePak Carrier is a reusable, temporary package that enables IC manufacturers to perform final test and burn-in of bare die and modules. Aehr Test Systems was incorporated in 1977 and is headquartered in Fremont, California.","Energy Services of America Corporation provides contracting services for utilities and energy related companies in the United States. It constructs, replaces, and repairs interstate and intrastate natural gas pipelines and storage facilities for utility companies and private natural gas companies; and provides services relating to pipeline, storage facilities, and plant works. The company also offers a range of electrical and mechanical installation, and repair services, including substation and switchyard, site preparation, equipment setting, pipe fabrication and installation, packaged buildings, transformers, and other ancillary works for the gas, petroleum power, chemical, water and sewer, and automotive industries. It provides liquid pipeline and pump station construction, production facility construction, water and sewer pipeline installation, and various maintenance and repair services, as well as other services related to pipeline construction. The company serves customers primarily in West Virginia, Virginia, Ohio, Pennsylvania, and Kentucky. Energy Services of America Corporation was incorporated in 2006 and is based in Huntington, West Virginia.","Extreme Networks, Inc. provides software-driven networking solutions worldwide. It designs, develops, and manufactures wired and wireless network infrastructure equipment; and develops software for network management, policy, analytics, security, and access controls. The company offers ExtremeCloud IQ, an ML/AI powered, wired, and wireless cloud network management solution that offers advanced visibility and control over users, devices, and applications; ExtremeCloud IQ \u0096 Site Engine that provides task automation, access control, granular visibility with real-time analytics and multi-vendor device management; and ExtremeCloud IQ Essentials offers WIPS, location services, IoT, and guest management services. It also provides wireless access point products; ExtremeSwitching portfolio that includes access edge products that offer physical presentations along with options to deliver Ethernet or convergence-friendly Power-over-Ethernet (POE), including high-power universal POE; aggregation/core switches designed to address aggregation, top-of-rack, and campus core environments; and data center switches and routers. In addition, the company offers cloud native platforms and applications for service providers; and customer support and services. It markets and sells its products through distributors, resellers, and field sales organizations to healthcare, education, government, manufacturing, retail, and hospitality markets. Extreme Networks, Inc. was incorporated in 1996 and is headquartered in Morrisville, North Carolina.","The Vita Coco Company, Inc. develops, markets, and distributes coconut water products under the Vita Coco brand name in the United States, Canada, Europe, the Middle East, and the Asia Pacific. The company offers coconut oil and coconut milk; Hydration Drink Mix, a powdered form of flavored coconut water; sparkling water; Runa, a plant-based energy drink; purified water under the Ever &amp; Ever brand name; and PWR LIFT, a protein-infused fitness drink. It distributes its products through club, food, drug, mass, convenience, e-commerce, and foodservice channels. In addition, the company supplies coconut water and coconut oil categories to retailers. The company was formerly known as All Market Inc. and changed its name to The Vita Coco Company, Inc. in September 2021.The Vita Coco Company, Inc. was founded in 2004 and is headquartered in New York, New York.","Climb Global Solutions Inc. operates as a value-added information technology (IT) distribution and solutions company in the United States, Canada, Europe, the United Kingdom, and internationally. It operates in two segments, Distribution and Solutions. The company distributes technical software and hardware to corporate and value added resellers, consultants, and systems integrators under the names Climb Channel Solutions and Sigma Software Distribution; and software, hardware, and services under the names TechXtend and Grey Matter. It also resells computer software and hardware developed by others, as well as provides technical services to end user customers. In addition, the company offers a line of products from various software vendors; and tools for virtualization/cloud computing, security, networking, storage and infrastructure management, application lifecycle management, and other technically sophisticated domains, as well as computer hardware. Climb Global Solutions Inc. markets its products through its own web sites, local and on-line seminars, events, webinars, and social media, as well as direct email and printed materials. It provides IT distribution and solutions for companies in the security, data management, cloud, connectivity, storage and HCI, virtualization, and software and ALM industries. The company was formerly known as Wayside Technology Group, Inc. and changed its name to Climb Global Solutions Inc. in October 2022. Climb Global Solutions Inc. was incorporated in 1982 and is headquartered in Eatontown, New Jersey.","Broadcom Inc. designs, develops, and supplies various semiconductor devices with a focus on complex digital and mixed signal complementary metal oxide semiconductor based devices and analog III-V based products worldwide. The company operates in two segments, Semiconductor Solutions and Infrastructure Software. It provides set-top box system-on-chips (SoCs); cable, digital subscriber line, and passive optical networking central office/consumer premise equipment SoCs; wireless local area network access point SoCs; Ethernet switching and routing merchant silicon products; embedded processors and controllers; serializer/deserializer application specific integrated circuits; optical and copper, and physical layers; and fiber optic transmitter and receiver components. The company also offers RF front end modules, filters, and power amplifiers; Wi-Fi, Bluetooth, and global positioning system/global navigation satellite system SoCs; custom touch controllers; serial attached small computer system interface, and redundant array of independent disks controllers and adapters; peripheral component interconnect express switches; fiber channel host bus adapters; read channel based SoCs; custom flash controllers; preamplifiers; and optocouplers, industrial fiber optics, and motion control encoders and subsystems. Its products are used in various applications, including enterprise and data center networking, home connectivity, set-top boxes, broadband access, telecommunication equipment, smartphones and base stations, data center servers and storage systems, factory automation, power generation and alternative energy systems, and electronic displays. Broadcom Inc. was incorporated in 2018 and is headquartered in San Jose, California.","Bruker Corporation develops, manufactures, and distributes scientific instruments, and analytical and diagnostic solutions in the United States and internationally. The company operates through three segments: Bruker Scientific Instruments (BSI) Life Science, BSI NANO, and Bruker Energy &amp; Supercon Technologies. It offers life science tools, and single and multiple modality systems; life science mass spectrometry; MALDI Biotyper rapid pathogen identification platform and related test kits, DNA test strips, and fluorescence-based polymerase chain reaction technology; genotype and fluorotype molecular diagnostics kits; research, analytical, and process analysis instruments and solutions; SARS-CoV 2 testing for the diagnosis of COVID-19 infection; and Fluorotyper-SARS-CoV 2 plus kits. It also provides range of portable analytical and bioanalytical detection systems, and related products; X-ray instruments; analytical tools for electron microscopes, as well as handheld, portable, and mobile X-ray fluorescence spectrometry instruments; atomic force microscopy instrumentation; non-contact nanometer resolution solution topography; and automated X-ray metrology, automated AFM defect-detection, and photomask repair and cleaning equipment. In addition, the company offers advanced optical fluorescence microscopy instruments; products and services to support the multi-omics needs of researchers in translational research, drug, and biomarker discovery; superconducting materials, such as metallic low temperature superconductors; devices and complex tools based on metallic low temperature superconductors; and non-superconducting high technology tools, such as synchrotron and beamline instrumentation. Bruker Corporation has a collaboration with Newomics Inc. on a LC-MS platform for drug discovery. The company was incorporated in 1991 and is headquartered in Billerica, Massachusetts.","Eltek Ltd. manufactures, markets, and sells printed circuit boards (PCBs) in Israel, Europe, North America, India, the Netherlands, and internationally. The company offers a range of custom designed PCBs, including rigid, double-sided, and multi-layer PCBs, and flexible circuitry boards. It also offers high density interconnect, flex-rigid, and multi-layered boards. It primarily serves manufacturers of defense and aerospace, medical, industrial, telecom, and networking equipment, as well as contract electronic manufacturers and others. The company markets and sells its products primarily through direct sales personnel, sales representatives, and PCB trading and manufacturing companies. Eltek Ltd. was incorporated in 1970 and is headquartered in Petach Tikva, Israel. Eltek Ltd. is a subsidiary of Nistec Golan Ltd.","Flexsteel Industries, Inc., together with its subsidiaries, operates as a manufacturer, importer, and online marketer of upholstered and wooden furniture for residential and contract markets in the United States. It offers upholstered furniture, such as sofas, loveseats, chairs, reclining and rocker-reclining chairs, swivel rockers, sofa beds, convertible bedding units, occasional tables, desks, dining tables and chairs, and bedroom furniture. The company distributes its products through e-commerce channels and dealer network. Flexsteel Industries, Inc. was founded in 1893 and is based in Dubuque, Iowa.","Apple Inc. designs, manufactures, and markets smartphones, personal computers, tablets, wearables, and accessories worldwide. The company offers iPhone, a line of smartphones; Mac, a line of personal computers; iPad, a line of multi-purpose tablets; and wearables, home, and accessories comprising AirPods, Apple TV, Apple Watch, Beats products, and HomePod. It also provides AppleCare support and cloud services; and operates various platforms, including the App Store that allow customers to discover and download applications and digital content, such as books, music, video, games, and podcasts. In addition, the company offers various services, such as Apple Arcade, a game subscription service; Apple Fitness+, a personalized fitness service; Apple Music, which offers users a curated listening experience with on-demand radio stations; Apple News+, a subscription news and magazine service; Apple TV+, which offers exclusive original content; Apple Card, a co-branded credit card; and Apple Pay, a cashless payment service, as well as licenses its intellectual property. The company serves consumers, and small and mid-sized businesses; and the education, enterprise, and government markets. It distributes third-party applications for its products through the App Store. The company also sells its products through its retail and online stores, and direct sales force; and third-party cellular network carriers, wholesalers, retailers, and resellers. Apple Inc. was incorporated in 1977 and is headquartered in Cupertino, California.","Cross Country Healthcare, Inc. provides talent management and other consultative services for healthcare clients in the United States. The company operates in two segments, Nurse and Allied Staffing and Physician Staffing. The Nurse and Allied Staffing segment offers traditional staffing, including temporary and permanent placement of travel nurses and allied professionals, local nurses, and allied staffing; staffing solutions for registered nurses, licensed practical nurses, certified nurse assistants, practitioners, pharmacists, and other allied professionals on per diem and short-term assignments; and clinical and non-clinical professionals on long-term contract assignments, as well as workforce solutions, including MSP, RPO, and consulting services. It also provides retained search services for healthcare professionals, as well as contingent search and recruitment process outsourcing services. This segment serves public and private acute care and non-acute care hospitals, government facilities, local and national healthcare plans, managed care providers, public and charter schools, outpatient clinics, ambulatory care facilities, physician practice groups, and other healthcare providers under the Cross Country brand. The Physician Staffing segment provides physicians in various specialties, certified registered nurse anesthetists, nurse practitioners, and physician assistants under the Cross Country Locums brand as independent contractors on temporary assignments at various healthcare facilities, such as acute and non-acute care facilities, medical group practices, government facilities, and managed care organizations. The company was founded in 1986 and is headquartered in Boca Raton, Florida.","F5, Inc. provides multi-cloud application security and delivery solutions for the security, performance, and availability of network applications, servers, and storage systems. The company's multi-cloud application security and delivery solutions enable its customers to develop, deploy, operate, secure, and govern applications in any architecture, from on-premises to the public cloud. It offers application security and delivery products, including BIG-IP appliances and VIPRION chassis and related software modules and software-only Virtual Editions; Local Traffic Manager and DNS Services; Advanced Firewall Manager and Policy Enforcement Manager that leverage the unique performance characteristics of its hardware and software architecture; Application Security Manager and Access Policy Manager; NGINX Plus and NGINX Controller; Shape Defense and Enterprise Defense; Secure Web Gateway, and Silverline DDoS and Application security offerings; and online fraud and abuse prevention solutions. The company also provides a range of professional services, including consulting, training, installation, maintenance, and other technical support services. F5, Inc. sells its products to large enterprise businesses, public sector institutions, governments, and service providers through distributors, value-added resellers, managed service providers, and systems integrators in the Americas, Europe, the Middle East, Africa, and the Asia Pacific region. It has partnerships with public cloud providers, such as Amazon Web Services, Microsoft Azure, and Google Cloud Platform. The company was formerly known as F5 Networks, Inc. and changed its name to F5, Inc. in November 2021. F5, Inc. was incorporated in 1996 and is headquartered in Seattle, Washington.","Accenture plc, a professional services company, provides strategy and consulting, interactive, and technology and operations services worldwide. The company offers application services, including agile transformation, DevOps, application modernization, enterprise architecture, software and quality engineering, data management, intelligent automation comprises robotic process automation, natural language processing, and virtual agents, and liquid application management services, as well as program, project, and service management services; strategy consulting services; critical data elements, data management and governance, data platform and architecture, product-based organization and skills, business adoption, and value realization services; engineering, and research and development digitization; smart connected product design and development; product platform engineering and modernization; product as-a-service enablement; products related to production and operations; autonomous robotics systems; the digital transformation of capital projects; and digital industrial workforce solutions. It also provides data-enabled operating models; technology consulting and artificial intelligence services; services related to talent and organization/human potential; digital commerce; infrastructure services, such as hybrid cloud, network, digital workplace and collaboration, service and experience management, infrastructure as code, and managed edge and IoT devices; cyber defense, applie
